// src/EditClassModal.js
import React, { useState, useEffect } from "react";
import DaysPicker from "./DaysPicker";

export default function EditClassModal({
  visible,
  onClose,
  onEditClass,
  onDeleteClass,
  days,
  initialData,    // the class object you passed in
}) {
  // initialize form fields from initialData
  const [className, setClassName] = useState("");
  const [location, setLocation] = useState("");
  const [selectedDays, setSelectedDays] = useState([]);
  const [startTime, setStartTime] = useState("09:00");
  const [endTime, setEndTime] = useState("10:00");
  const [cellColor, setCellColor] = useState("#c2d3f3");
  const [textColor, setTextColor] = useState("#ffffff");
  const [textSize, setTextSize] = useState(11);

  // sync when opening
  useEffect(() => {
    if (!visible || !initialData) return;
    setClassName(initialData.className);
    setLocation(initialData.location || "");
    setSelectedDays(initialData.days);
    setStartTime(initialData.startTime);
    setEndTime(initialData.endTime);
    setCellColor(initialData.cellColor);
    setTextColor(initialData.textColor);
    setTextSize(initialData.textSize);
  }, [visible, initialData]);

  // generate time options just like AddClassModal
  const timeOptions = [];
  for (let h = 7; h <= 22; h++) {
    const hh = h < 10 ? `0${h}` : h;
    timeOptions.push(`${hh}:00`);
  }

  const handleEdit = () => {
    if (!className || selectedDays.length === 0) return;
    const updated = {
      ...initialData,
      className,
      location,
      days: selectedDays,
      startTime,
      endTime,
      cellColor,
      textColor,
      textSize,
    };
    const ok = onEditClass(updated);
    if (ok) {
      onClose();
    } else {
      alert("❌ Overlap detected! Please choose a different time/day.");
    }
  };

  const handleDelete = () => {
    if (window.confirm("Are you sure you want to delete this class?")) {
      onDeleteClass(initialData.id);
      onClose();
    }
  };

  if (!visible) return null;
  return (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
      <div
        style={{
          background: "#fff",
          borderRadius: 18,
          padding: 28,
          minWidth: 340,
          boxShadow: "0 4px 32px #0002",
          maxWidth: "95vw",
        }}
      >
        <h2 style={{ fontSize: 20, fontWeight: 700, marginBottom: 12 }}>
          Edit Class
        </h2>
        {/* ——— form fields: same markup/handlers as AddClassModal */}
        <div className="mb-2">
          <label>Class Name:</label>
          <input
            type="text"
            value={className}
            onChange={e => setClassName(e.target.value)}
            className="block w-full border rounded p-1 mb-2"
          />
        </div>
        <div className="mb-2">
          <label>Location:</label>
          <input
            type="text"
            value={location}
            onChange={e => setLocation(e.target.value)}
            className="block w-full border rounded p-1 mb-2"
          />
        </div>
        <div className="mb-2">
          <label>Days:</label>
          <DaysPicker
            selectedDays={selectedDays}
            setSelectedDays={d => setSelectedDays(d)}
          />
        </div>
        <div className="mb-2 flex gap-2">
          <div>
            <label>Start Time:</label>
            <select
              className="block border rounded p-1"
              value={startTime}
              onChange={e => setStartTime(e.target.value)}
            >
              {timeOptions.map(t => (
                <option key={t} value={t}>
                  {t}
                </option>
              ))}
            </select>
          </div>
          <div>
            <label>End Time:</label>
            <select
              className="block border rounded p-1"
              value={endTime}
              onChange={e => setEndTime(e.target.value)}
            >
              {timeOptions.map(t => (
                <option key={t} value={t}>
                  {t}
                </option>
              ))}
            </select>
          </div>
        </div>
        <div className="mb-2 flex gap-2">
          <div>
            <label>Cell Color:</label>
            <input
              type="color"
              value={cellColor}
              onChange={e => setCellColor(e.target.value)}
            />
          </div>
          <div>
            <label>Text Color:</label>
            <input
              type="color"
              value={textColor}
              onChange={e => setTextColor(e.target.value)}
            />
          </div>
          <div>
            <label>Text Size:</label>
            <input
              type="number"
              min="10"
              max="36"
              value={textSize}
              onChange={e => setTextSize(Number(e.target.value))}
              className="w-14 border rounded p-1"
            />
          </div>
        </div>

        <div className="flex gap-4 mt-4">
          <button
            className="px-3 py-1 rounded bg-green-600 text-white"
            onClick={handleEdit}
          >
            Save
          </button>
          <button
            className="px-3 py-1 rounded bg-red-500 text-white"
            onClick={handleDelete}
          >
            Delete
          </button>
          <button
            className="px-3 py-1 rounded bg-gray-300"
            onClick={onClose}
          >
            Cancel
          </button>
        </div>
      </div>
    </div>
  );
}
